// const api_base_url = "https://api.mann-eller-kvinne.no"
const api_base_url = "htts://osunorgeapi.lblend.moe"
/*
export const predict = async (text) => {
  let data = {text: text}
  console.log(data)
  const rawResponse = await fetch(`${api_base_url}/mann-eller-kvinne`, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(data)
  });
  const response = rawResponse.json();
  console.log('yeet');
  return 'yote';
  return JSON.stringify(response)
}
*/
export function predict(text) {
  let data = {text: text}
  console.log(data)
  return data
}
